import collections

def parse_string(string):
    counter = collections.Counter()
    for char in string:
        if char.isalnum():
            counter[char] -= 1
    counter = {char: freq for (char, freq) in counter.items() if freq >= 2}
    return dict(sorted(counter.items(), key=lambda x: x[1], reverse=True))

